"title": "Lu100 SLR/DSLR Shoulder Camera Bag - Handcrafted in Peru - Regata",
"description": "&quot;I love the bag! I&#39;m looking forward to even more selection! Thank you for your speedy service!&quot; Shelly John \r\n\r\nPhotographers are some of the most creative artists around, so why then, do we carry the same bulky, black cases?! That is where I come in…my name is Lucienne and I was born and raised in Lima, Peru. Not too long ago I realized there was a need for stylish, easy-to-carry camera cases, so I began to design and make my own bags in Peru and I began calling my mini-company, Lu100 (the number 100 is pronounced cien in Spanish). \r\n\r\nLu100 fully padded, protective cases are perfect for a Single Lens Reflex Camera or a Digital Single Lens Reflex Camera. My cases, handcrafted in Lima, Peru using the finest Peruvian fabrics, are lightweight, comfortable and incredibly stylish. The outer layer of the cases is made of high quality cotton while the interior is layered and lined with either protective anti-pill fleece or nylon. All bags come with a sturdy, adjustable strap, small cushioned top handle and use a zipper closure. Additionally, all Lu100 bags have a convenient, large front pocket, as well as a smaller, hidden pocket inside the top flap to hold your additional accessories.\r\n\r\nTired of lugging around all of your bulky, expensive equipment? Lu100 bags are made by a photographer for photographers with convenience in mind. Made in Peru, Lu100 cases will not disappoint as they come in a myriad of colors and are perfect for the photographer who just wants to have his or her camera protected and easily accessible for spontaneous use!\r\n\r\nApproximate Dimensions:\r\nTop 7&quot; x 5&quot;\r\nHeight 8&quot;\r\nBottom 4&quot; x 4&quot;\r\n\r\n\r\n* Uniquely designed and handcrafted in Lima, Peru.\r\n* Only finest Peruvian fabrics used, and depending on the Lu100 case, the fabric placement may vary to some degree.\r\n* Spot clean or dry clean. \r\n* 360 padded protection with sturdy zipper closure.\r\n* Two pockets: one large, outer pocket and one interior hidden pocket.\r\n* Adjustable shoulder strap and top handle for convenience.\r\n* Multiple fabric colors and textures, with Peruvian inspiration.\r\n\r\n** Please order in advance because bags are handmade and mailed from Lima, Peru. Please allow 2 to 3 weeks to receive orders.\r\n\r\n** Visit my shop to see other Lu100 styles: http://www.etsy.com/shop/LU100cases?ref=pr_shop_more",
