"description": "This vintage Kodak Signet 35 Rangefinder camera from the 50&#39;s uses 135 film and includes a aluminum No. 22 lens adapter ring and screw on lens hood.  The body is a combination of what appears to be brushed aluminum, chrome steel, and black textured steel.\r\n\r\nThis is a great item for a photo or movie prop, as a film/photography decor item, upcycle or repurpose into a custom project or add to a vintage film & photography collection.  \r\n\r\nThe mechanical functions seem to work as designed, however as I am not a camera shop or repair person and it has not been fully tested with actual film, I cannot state that it is in working condition.  \r\n\r\nMeasurements:\r\n\r\nHeight:  3 1/4&quot;\r\nWidth:  4 5/8&quot;\r\nDepth:  2 1/2&quot;  (overall from lens face to camera back)\r\nBody Depth:  1 1/2&quot;\r\nLens Diameter:  1/2&quot;\r\nLens Body Diameter:  1 3/4&quot;\r\n\r\nGood overall physical condition.  The metal surface has wear, tarnish and rub marks from age and use.  The lenses and viewfinder have some visible dust accumulation.  \r\n\r\nThe shipping specified is calculated to go coast to coast. Please convo with your zip code for a more accurate shipping rate quote. The same applies to Canada and International shipping so please convo with your postal code for a rate quote.\r\n\r\nConvo with any questions and thanks for looking!\r\n\r\nPlease click the link below to see more vintage Photography & Film items:\r\n\r\nhttps://www.etsy.com/shop/MetalAndTweed?section_id=14472471&ref=shopsection_leftnav_2\r\n\r\nCheck out the rest of MetalandTweed by clicking the link below:\r\n\r\nhttps://www.etsy.com/shop/MetalAndTweed?ref=si_shop",
