"announcement": "Metal and Tweed, a member of the Recycleista family, is your source for vintage items ranging from mid century modern to rustic industrial salvage. We also offer vintage menswear, photography equipment, calculators, electronics and an assortment of other retro goods.\r\n\r\nMy wife and I have always enjoyed the search and recovery of quality vintage items and through Etsy we are able to help provide for our family while helping pair up these great items with those who will appreciate and cherish them for years to come.  \r\n\r\nWe are located near Seattle in the small town of Wilkeson, WA in the foothills of the Cascade Mountain Range with a daily view of awe-inspiring Mt. Rainier, originally known as Tahoma, which has inspired the name of our salvaged supplies shop TahomaSalvageSupply.  \r\n\r\nPlease enjoy what we have to offer at MetalandTweed and visit our sister shops at: \r\nhttp://www.etsy.com/shop/TahomaSalvageSupply\r\nhttp://www.etsy.com/shop/TheRecycleista\r\nhttp://www.etsy.com/shop/VintagePaperology",
