"vacation_message": null,
"sale_message": "Thanks so much for buying this item from our shop. We want you to be 100% satisfied with any purchase you make. Please feel free to contact us with any problems and we will do our best to help. If you are buying one of our backdrops (or have in the past), we need your help.We need fresh photos of our backdrops and we would like to see what you have. Here is the deal:\r\nAfter receiving your backdrop and using it, Go to our Facebook Page here: https://www.facebook.com/OwensBackdrops?ref=br_rs and like it if you haven&#39;t already.\r\nSecond: Send any photos using our backdrops to bradowen@hotmail.com (Be sure to include your Facebook page address) Also, be sure you have a model release in hand as we may post these on our regular website as well as Etsy and  Facebook. Also, if possible a product name and item # would be helpful but not required\r\nLast: After review, we may post the images as well as links to your page on our Facebook page. Also, after we receive the image (images), we will send you a coupon good for 10% off your next order.\r\n\r\nThanks! \r\nOwen&#39;s Originals",
"digital_sale_message": null,
