"description": "This listing is for 4 late 70s retro 35mm magazines.\n\nArticles include, Plladiuim printing, a blind photographer&#39;s album, Street photography Romanian style, a screen printing howto, The color printer&#39;s bible, How to make sequential portraits, portable darkroom (dark tents), 20 years of photojournalism…various equipment and camera howtos and buying guides….tips for becoming a professional photographer….biographies and galleries of 35mm artists….and much more!\n\n\nThe articles are amply illustrated with many B&W prints….with a few color pages in each magazine…\nWith many retro camera, film and equipments ads...\nand many articles and images of photojournalism and art photography…\n\n\n35-mm photography \n\npublished by Ziff-Davis Publishing Company \n\n\nspring and winter 1977\nspring and winter 1978\n\neach measures: a bit over 10 and 7/8ths inches by a bit over 8 and 1/2 inches wide \n\nCONDITION: 1978- speckled fading and discoloration to length of spine and around spine on cover. Winter 1978- spine cracked both sides, binding glue delicate…still bound. edges of some pages a bit ripply. Has ripply-ness along spine like with other 78 issue but more subtle. \nWinter 1977- spine cracked in front, rip to lower spine- not as delicate as winter 78 issue- more solidly bound, has a medium rip on first page.\n\nIssues Spring 77 and 78 are ripply along spine, effects most pages, hard to completely open in middle, when flattened pages buckle a bit. (see pics for details) Should not effect read or view ability overall. The other two issues are ripply but a lot more subtly….easier to turn pages as well. \n\nThe covers all have regular vintage wear to varying degrees….but none that are in bad condition…. has a lot of light discoloration, some staining, scuffing, creases, smudges, little rips and wear about the edges. \nPages have regular vintage wear from an avid yet gentle reader.\nAn antique tint to the pages. \n\nTake a peek at my other 50s to 70s retro photography magazines:\nFirst up on the list is another lot of 35mm magazines from the late 60s to early 70s...\n\nhttps://www.etsy.com/listing/219466354/35mm-photography-ziff-davis-60s-70s\n\nhttps://www.etsy.com/listing/219443781/photography-annual-ziff-davis-1950s\n\nhttps://www.etsy.com/listing/218686162/lot-of-7-color-photography-magazines\n\nhttps://www.etsy.com/listing/218396363/popular-photographys-woman-ziff-davis\n\nhttps://www.etsy.com/listing/218399721/us-camera-annual-72-photojournalism\n\nhttps://www.etsy.com/listing/218549580/invitation-to-photography-fully\n\nhttps://www.etsy.com/listing/218550051/modern-photography-annual-illustrated\n\nand also look for more on the way!\n\nwe combine shipping- just ask!\n\n$25.00\n\nshipping: 13.00",
