"description": "Camera travel bag - leather camera ipad tablet travel satchel bag - zip pocket, iPad sleeve, multi pocket satchel, dark brown leather.  For more handmade leather briefcases, lap top bags, portfolio, computer bags, work/business bags please click here: http://etsy.me/1mfOvP3\n\nTo go back to my shop click here: http://etsy.me/1h3PZXZ\n\nMy 10 hour camera satchel, has the most features than any bag that we have ever made. This leather camera bag has room for your iPad, camera, and lots of extras and its extremely wide.\n\nmade to order - made from scratch customizable \n\nFEATURES\n- 10 special features\n   11 inches wide\n   6 inches on the side\n   cinching sides that expand and minimize width\n   iPad sleeve\n   zippered back pocket\n   two front pockets with gussetts and brass closure\n   one side flat pocket with flap and closure\n   water bottle holder that can expand and minimize width\n   triple leather handle\n     New handle with side extensions\n   hand sewn leather handle with triple leather\n   and doubled stitched on the edge and inside\n   cross body strap thats expandable and detachable \n   brass hardware\n   single buckle closure\n   made out of one continous piece of leather \n   not made out of many pieces\n   no glue, no lining, no machines, no robots, no electricity\n   beautitul thick raw leather\n   wax and oil finsih, water repellent\n\n\nThis is an introductury bag in our collection \nand its priced at this rate for a limited time.\n \nCUSTOMIZATION\ncan be made in any size with any added features\nany changes will changes the price please convo me for pricing\n\nThis bag is mOUR MOTTO PROMISE\nmade to order\nno glue\nno machines\nno lining\nthick raw natural leather\ngood strong weight\nhand sewn twice \nminimal pieces one piece of leather or two not pieces\nno electricity was used to make your bag\nno robots\n\nONLY HUMAN HANDS WITH PEACE AND LOVE\nMADE IN AMERICA\nNEW YORK CITY, USA\n\nade to order and it will be a unique copy of itself.\n\n\n\n\nCannot be used with coupon code\n\nSHIPPING\nMade to order. Made within 12 to 14 days and then shipped priority mail with tracking.\nInternational orders may have to wait\n4 to 5 weeks for bag to arrive\n\nthank u\npeace from NYC\naixa",
