"accepts_custom_requests": false,
"policy_welcome": "Welcome to my shop. I like finding new homes for lovely old things. Enjoy.\r\n",
"policy_payment": "PayPal only at this time. \r\n\r\n",
"policy_shipping": "I ship only to addresses with the U.S. at this time. This may change, but international mail is often slow and with no way of tracking a package once it leaves the U.S., so I prefer to mail within country. HOWEVER, If there is something you are desperate to have and are not in a hurry, please do convo me and I may be able to accommodate. \r\n\r\nI mail out within five business days of receipt of payment and usually within 1-2 business days. \r\n\r\nCombined shipping: I combine shipping where I can. Since it&#39;s not always possible (some things need a mailing tube, others a box or envelope), my shipping fees for &quot;additional item&quot; shipping may be estimated on the high side. Any fee more than $2 above actual shipping cost can be refunded, if you will just bring it to my attention.",
"policy_refunds": "All purchases are pre-loved and vintage, so there will be flaws that I try my best to describe or show you via photos. Please inspect all photos, and read the item descriptions for condition and sizes. If you have questions, let me know.\r\n\r\nOf course, if I&#39;ve missed describing something adequately or there is some other issue, please let me know. The most important thing is that you feel respected as a customer and happy with the transaction. I hope that helps you buy with confidence at my shop. I am eager to work with you.\r\n\r\nIf an item arrives damaged or in an unsatisfactory condition (a rare occurrence, but it could happen), I am happy to work with you. But do follow these guidelines.\r\n\r\n1. Please let me know within 14 days.\r\n\r\n2. For the bulk of my inventory ($8 or less), just describe the issue, and I will usually be able to offer a refund or replacement, whichever works best for you.\r\n\r\n3. For books, non-paper items, or expensive paper items (over $10), I may ask for photos of the damage and/or for the item to be returned before issuing a refund. \r\n",
"policy_additional": "If you are looking for a particular item, especially a magazine ad, convo me. I have hundreds of items not yet listed.\r\n\r\nCustom Order: Need a certain collage pack (magazine clippings) for an art project you have in mind? Let me know. I might be able to put together a pack on your desired subject for you. ",
