"announcement": "Welcome to Dollbirdies! Thank you for taking your valuable time to browse the products I spend much of my time creating! Please read Dollbirdies listings and policies carefully before purchasing as Dollbirdies is a final sales shop. Please be a serious shopper as all sales are final and there are no refunds or exchanges. When you purchase an item from Dollbirdies you are agreeing to abide by Dollbirdies shop policies. I have been producing, creating and marketing unique handcrafted items which are stylish and timeless, fun and practical, whimsical and useful  for over thirty years through many different venues. I only create things I love and use myself, and I look forward to helping you find items you will love and use too!\r\n\r\nInternational customers must be prepared to pay for and be aware of any customs or fees their country may require upon receipt of their purchases. International customers must also be aware of currency exchanges between the currency of their individual country and that of the United States. *Individual listings now reflect the significant increases that have been made in First Class International Shipping prices.\r\n\r\nCancellation of an order is only possible within the first twenty-four hours after placement  if the order has not been shipped. \r\n\r\nDollbirdies cannot be held responsible for any package that might be misplaced, mishandled or lost once placed in the hands of the carrier.\r\n\r\nPlease read Dollbirdies Policy section carefully for more information. These policies are a product of considerable thought and merchandising experience and have been constructed for the mutual benefit of both Dollbirdies and her customers.",
