"description": "Give your camera strap a personality to match your own! Dollbirdies SLR/DSLR camers strap sleeves are constructed from a combination of designer cotton fabric prints that are fun, trendy, bright, and fashionable to match your personal style. These sleeves are interfaced for stability, lined with cotton batting for cushioning and finished on the back with soft fleece for comfort. Dollbirdies camera strap sleeves are approximately 34”-36” long and 2 ½” wide. Dollbirdies strap sleeves are comfortable, cute, and so affordable you may want more than one! These sleeves easily slide over your existing camera strap to add comfort while using your camera.\r\n\r\n(Carefully use a large safety pin or diaper pin attached to your existing nylon camera strap to thread the camera’s strap through the sleeve or tape your camera strap to the end of a yardstick and thread strap through sleeve.)\r\n\r\nMultiple items fashioned from the same fabrics will vary in fabric placement. \r\n\r\nSpot clean, air dry, steam press.\r\n\r\nAny additional items used in the photos are for display only.\r\n\r\nItem ships via USPS Priority Mail to all domestic addresses with Delivery Confirmation and First Class International Mail to all international addresses for which no tracking is available for purchase. International customers are responsible for any custom fee or value added tax  required from their respective country upon delivery.",
