"policy_additional": "Customers must be aware that most items must be constructed when their orders are placed. Please read the listings carefully. Items that require a two week construction period will read so in the beginning line of their listing. Due to variations in computer monitors colors of the merchandise photographed may vary as well. For this reason Dollbirdies always tries to include the color of  fabrics in the tags at the bottom of each individual listing. \r\n\r\nAll custom orders are not returnable or refundable and must be paid for in full before construction begins.Custom orders will be constructed in the order in which \r\nDollbirdies receives them. Customers need to allow two weeks for the construction of their custom orders after I receive the necessary materials that may have to be ordered.  Most special ordered fabrics reach me within 5-7 days after placing the order. If there should be a delay in construction the buyer will be notified by Dollbirdies immediately with an explanation as to why.\r\n\r\nAll transactions, including Custom Orders should be completed within three days of putting the item in your cart or within three days of posting the listing. If the transaction is not completed within three days, and if Dollbirdies has not been contacted by the customer, Dollbirdies reserves the right to place the merchandise back up for sale or to remove the custom listing from the shop without contacting the customer.\r\n\r\nAll items are handmade and you must allow for any variances that may slightly differ from the actual photos. You cannot make items by hand and find them to be identical! You cannot make multiple items from the same fabric and find them to be identical. Fabric placement is  considered when crafting each item. All dimensions may vary slightly as each item is individually made. When ordering multiple items of the same design and in the same fabrics you will find they will all differ in fabric placement. Almost all seams are double sewn for added strength and stability while handles are sewn repeatedly to ensure security. \r\n\r\n*The interior lining of some bags may differ from the stock photos of each bag in a specific print due to the fact that fabrics are often discontinued by their manufacturers and therefore unavailable for purchase. When this happens, Dollbirdies uses a companion print either from the same fabric group, or a coordinating print within the same color palate to use for the bag interior.\r\n\r\n** CHARITABLE REQUESTS:  Due to overwhelming weekly requests on the behalf of individuals, individual bloggers, groups and organizations, etc. Dollbirdies has chosen to no longer participate in donating free merchandise for fund raisers, give-a-ways, product reviews, advertising, auctions or charity donations. \r\n\r\nPlease do not make these types of requests any longer! This was an agonizing, well considered decision that Dollbirdies has been forced to make due to overwhelming requests for free merchandise. \r\n\r\nDollbirdies chooses to continue to participate in making charitable donations through other means to groups of my own choosing. \r\n\r\n***WHOLESALE: Dollbirdies does not wholesale but gives a small discount for large, bulk orders for those customers who are making purchases of favors for large parties or groups, etc.\r\n\r\n****NO MULTIPLE ORDER DISCOUNTS are available for those making several purchases of items of merchandise, whether they are all the same item or different items and  whether they are constructed from matching fabrics or different fabrics.  \r\n\r\n*****BRIDES!  For those Brides who are making a purchase of five or more items for their bridal party, Dollbirdies will combine appropriate shipping cost for the items and give a 10% discount on the total for the items purchased as long as the items are identical and constructed with the same fabrics. **There can be no discounts for Brides who choose to either combine items or who choose to purchase identical items but want the items to be constructed with multiple companion prints or coordinating prints.\r\n\r\n** I would like for my customers to please respect my policies and understand that I am not a part-time craft person. I do not run Dollbirdies for &quot;fun&quot; or to &quot;amuse&quot; myself in my spare time or for &quot;extra cash.&quot; I am a full time business woman who has chosen to work from home in order to support my family. I have been merchandising my hand crafted items for over thirty years through various venues. The quality of my merchandise is important to me as is my business reputation. Through Dollbirdies, I offer to the public, quality merchandise at a fair price. Dollbirdies is not open for business to haggle, to barter, or to exchange goods. Like everyone else, I work hard in order to pay my bills and support the people I love. \r\n\r\n\r\nLAUNDRY RECOMMENDATIONS:\r\nCarefully note all laundry suggestions for Dollbirdies merchandise. It is impossible to launder some bags because of their hardware, even though the materials used in construction are machine washable. To extend the life of each Dollbirdie bag and to cut out unnecessary laundering, it is suggested upon receipt of the item to Scotch Guard it. If you find it necessary to launder your item Dollbirdies recommends spot cleaning or hand washing in cold water with a mild detergent, air drying the item, and steam ironing any wrinkles. However, unless the fabric has been noted as &quot;dry clean only&quot;, a bag can be, if absolutely necessary, laundered in cold water on a gentle cycle with mild detergents and removed from the machine before the spin cycle. Gently squeeze out all the water that you possibly can and then allow machine laundered bags to drip and air dry as much as possible. (If you must machine dry your bag do so on the lowest heat setting on your machine to remove any remaining excess water and to reduce shrinkage.) Allowing items to air dry is best, followed by steam pressing. Wrinkles can be removed best by the use of a steam iron. Always remove any hard bottom from a bag before laundering. Do not launder any hard bottom. All batting used in construction of padded Dollbirdies bags, aside from insulbright used in insulated lunch totes, is 100% cotton and will shrink when laundered and dried in a machine.",
