"policy_welcome": "Thank you for taking your time to visit with Dollbirdies! I hope you have found a Dollbirdie item you love either for yourself or for someone whom you love. Each Dollbirdie item is carefully handcrafted with quality materials and with attention to details by myself, one at a time. My items are not mass produced. They are constructed one at a time with great care and inspection. I enjoy making items that are stylish enough to be fun and classic enough to be timelessly functional. Please come back and visit often! Please read Dollbirdies Policy section carefully for more information. These policies are a product of considerable thought and merchandising experience and have been constructed for the mutual benefit of both Dollbirdies and her customers. Dollbirdies is a final sales shop. Purchasing from Dollbirdies means you will abide by Dollbirdies shop policies. Any transaction cancellation by a customer must be received within 24 hours of placing the order.",
"policy_payment": "Pay Pal is my chosen method of payment. However, for those of you who do not have a Pay Pal account, you can use your credit card or an e-check with Pay Pal to purchase items without actually creating a Pay Pal account. Any transaction that does not have a confirmed payment within 72 hours of purchase will be re-listed for sale in the Dollbirdies shop. Any transaction completed on PayPal with a major credit card or an e-check will not ship until the pending funds are confirmed by PayPal.",
"policy_shipping": "Most domestic packages will ship via USPS Priority Mail with Delivery Confirmation. Once payment has been received, you order will be shipped promptly, usually within three to five days unless otherwise stated in the item&#39;s listing where it may be necessary to allow extra time for construction. Items that require a two week construction period will state this in the first line of the item&#39;s description.\r\n\r\nDollbirdies ships to Domestic, International and APO addresses.\r\n\r\nEven if you live in the same local area or in a near by area, Dollbirdies never allows merchandise to be picked up personally from the shop nor will Dollbirdies agree to meet with buyers to deliver merchandise. This policy is for the  safety of both Dollbirdies and the customer. It is to our mutual benefit to rely upon the carrier of Dollbirdies choice to handle the delivery of all packages with efficiency and cost effectiveness. \r\n\r\n Many ready to ship items can be shipped on the same day your Pay Pal amount has cleared, however in some cases, due to time constraints, the order will not ship until the following day. \r\n\r\nE-check payments or Major Credit Cards used to purchase merchandise through PayPal will not ship until notification has been made to Dollbirdies that the pending payment has cleared.  \r\n\r\nInternational packages weighing less than four pounds will ship First Class International Mail unless International Priority or International Express Priority rates are requested and paid for by the buyer. There are no tracking numbers available for purchase for International First Class mail.All  International packages require custom papers and the custom number can be made available for the buyer upon request. \r\n\r\nSome small items weighing less than 13 ounces may ship via USPS First Class Mail.  \r\n\r\nInsurance can be added to your purchase if you desire it by contacting Dollbirdies  when placing your order so the amount due can be adjusted to cover the cost. \r\n\r\nSome larger, heavier items, and some combined orders may ship via USPS Parcel Post with Delivery Confirmation due to weight and postal zone charges. \r\n\r\nAll domestic Dollbirdies merchandise is shipped with USPS Delivery Confirmation whether it is Priority Mail or First Class. An email notification will be sent to each customer when their package is shipped providing the Delivery Confirmation number.\r\n\r\n** International customers must be prepared to pay for and be aware of any customs or duty fees that may be required by their respective country. All said fees due are to be paid for by the buyer as they may apply for their respective countries. Dollbirdies has no knowledge of the customs or duty fees for international countries, nor does Dollbirdies have the ability to calculate and convert currency.  \r\n\r\nOrders that are shipped to countries outside of the U.S. may be subject to import taxes, customs duties and fees levied by the destination country (&quot;Import Fees&quot;). The recipient of an international shipment may be subject to such Import Fees, which are levied once a shipment reaches your country. Additional charges for customs clearance must be borne by the recipient; we have no control over these charges and cannot predict what they may be. Customs policies vary widely from country to country; you should contact your local customs office for further information. When customs clearance procedures are required, it can cause delays beyond our original delivery estimates.\r\n\r\nIt is the buyer&#39;s responsibility to ensure that the declared value (cost to the importer+shipping) that you put on the item is correct, as an incorrect declaration can get the importer fined or even prosecuted. I will not make a false declaration on a custom form.\r\n\r\n***No tracking numbers  are available for purchase for First Class International Mail, only Custom Numbers. Therefore there is no way for either Dollbirdies or the buyer to track their packages. Dollbirdies always appreciates being alerted when an international customer receives their merchandise. I am happy to provide customers with the custom number for any international package. Some countries provide limited tracking through custom numbers for customers to track through their local post office organizations.\r\n\r\n\r\n****On a rare occasion, it is possible that a package may be lost, stolen or misdirected while in route. Please know that Dollbirdies will not be held responsible for any package once it has been placed in the possession of the USPS or another carrier. Once a package is placed in the hands of the carrier, Dollbirdies has no control over the delivery and Dollbirdies is not responsible to replace any merchandise lost due to the mishandling or loss of a package by the \r\ncarrier.",
