"description": "This delightful little circular pouch is perfect for so many things; just let your imagination take wing! The zipper pouch is just right to nest your pesky ear buds to keep them from tangling, or it can act as a  handy pouch to hold your camera’s lens cap safe while shooting or  it can serve as a coin purse for spare change and lunch money, your lip ice, jewelry, a credit card and maybe a little cash! The circular pouch is designed with a lobster hook so it can be easily attached to a camera bag, a backpack, purse handles, a key chain, a belt loop, a button hole, etc. These pouches are constructed with bright, trendy, coordinating designer fabrics both inside and out and they are reinforced with interfacing for stability! These little pouches are so handy and so affordable you may find you will want more than one!  \r\n\r\nMultiple items constructed from the same fabrics will vary in fabric pattern placement. \r\n\r\nAny other items in the photos are for display only. \r\n\r\nSpot clean only. \r\n\r\nPouches are approximately 4” across.\r\n\r\nItem ships via USPS First Class Mail to all domestic addresses with Delivery Confirmation and First Class International Mail to all international addresses for which no tracking is available for purchase. International customers are responsible for any custom fee or value added tax  required from their respective country upon delivery.",
